import "./App.scss";
import logo from "./images/logo1.jpeg";
import logo1 from "./images/logo2.jpeg";

function App() {
  return (
    <div className="App">
      <nav className="nav">
        <div>
          <button>kja</button>
        </div>
        <div>
        <p style={{ textAlign: "center" }}>NextJs/ReactJs Assignment</p>
        </div>
      </nav>
      <div className="logo">
        <img src={logo} alt=".." style={{ width: "400px", padding: "5px" }} />
        <img src={logo1} alt=".." style={{ width: "400px" }} />
      </div>
    </div>
  );
}

export default App;
